using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;namespace Foundation{    /// <summary>    /// The NSMetadataQueryAttributeValueTuple class represents attribute-value tuples, which are objects that contain the attribute name and value of a metadata attribute.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/Cocoa/Reference/Foundation/Classes/NSMetadataQueryAttributeValueTuple_Class/index.html#//apple_ref/occ/cl/NSMetadataQueryAttributeValueTuple"/>    [iOSVersion(5)]    public class NSMetadataQueryAttributeValueTuple : NSObject//, AnyObject, NSObjectProtocol    {        /// <summary>        /// The attribute name for the tuple’s value. (read-only)        /// </summary>        [iOSVersion(5)]        [Export("attribute")]        public string Attribute { get; private set; }                /// <summary>        /// The number of instances of the value for the tuple’s attribute. (read-only)        /// </summary>        [iOSVersion(5)]        [Export("count")]        public int Count { get; private set; }                /// <summary>        /// The value of the tuple’s attribute. (read-only)        /// </summary>        [iOSVersion(5)]        [Export("value")]        public AnyObject Value { get; private set; }    }}